  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ZA VEZBU';
  name="Kralju";
  allUsers: User[] = []
  constructor(private userService: UserService){

  }
  getAllUsers(){
    this.userService.getAllUsers().subscribe(
      data=>{
        this.allUsers=data});
  }
}
